// 825. Friends Of Appropriate Ages

// Some people will make friend requests. The list of their ages is given and ages[i] is the age of the ith person.

// Person A will NOT friend request person B (B != A) if any of the following conditions are true:

// age[B] <= 0.5 * age[A] + 7
// age[B] > age[A]
// age[B] > 100 && age[A] < 100

// Otherwise, A will friend request B.

// Note that if A requests B, B does not necessarily request A.  Also, people will not friend request themselves.

// How many total friend requests are made?

// Example 1:

// Input: [16,16]
// Output: 2
// Explanation: 2 people friend request each other.

// Example 2:

// Input: [16,17,18]
// Output: 2
// Explanation: Friend requests are made 17 -> 16, 18 -> 17.

// Example 3:

// Input: [20,30,100,110,120]
// Output: 3
// Explanation: Friend requests are made 110 -> 100, 120 -> 110, 120 -> 100.


// Notes:

// 1 <= ages.length <= 20000.
// 1 <= ages[i] <= 120.

function numFriendRequests(ages: number[]): number {
    // Turns out that the union of the three clauses can be expressed thusly:
    //
    // A will friend request B iff
    //   B <= A and
    //   B > (A/2) + 7

    // Sort ages in ascending order so that age[j] >= age[i]
    ages.sort((a,b) => { return a - b })

    let friendRequests: number = 0

    for (let i = 0; i < ages.length; i++) {
        for (let j = 0; j < ages.length; j++) {
            if ((i == j) || (ages[i] < 15)) { continue }

            if ((ages[j] <= ages[i]) && (ages[j] > (0.5 * ages[i]) + 7)) { friendRequests++ }
        }
    }

    return friendRequests
};



